import React from 'react';
import '../assets/css/Global.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2023 Pixelate. All rights reserved.</p>
        <div className="social-links">
          <a href="/">Twitter</a>
          <a href="/">LinkedIn</a>
          <a href="/">Facebook</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
